// create arrays to store image information
// let imageArray = ["img1", "img2", "img3", "img4", "img5", "img6", "img7"];
// let base64Array = [img1, img2, img3, img4, img5, img6, img7];

// reference canvas
const canvas = document.getElementById("canvas1");

// reference context
const ctx = canvas.getContext("2d");

// define width and height
canvas.width = 1280;
canvas.height = 800;

// define counter
let i = 2;

// create and load first Image
const myImage = new Image();
myImage.src = "./img/img1.jpg";

// create animation frame reference
let myReq;

// create function which changes
setInterval(function () {
  if (i < 7) {
    cancelAnimationFrame(myReq);
    myImage.src = "./img/img" + i + ".jpg";
    i++;
  } else {
    i = 1;
  }
}, 40000);

myImage.addEventListener("load", function () {
  ctx.globalAlpha = 1;
  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  // create particle storage and number
  let particleArray = [];
  const numberOfParticles = 1000;

  // create array to store mapped image information
  let mappedImage = [];

  // map through image data
  // extract rgb values and brightness
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = [
        (cellBrightness = brightness - 1),
        (cellColour = `rgb(${red + (i + 13) * 5},${green - (i + 2) * 5},${
          blue - (i + 2) * 5
        })`),
      ];
      row.push(cell);
    }
    mappedImage.push(row);
  }

  //   calculate relative brightness for human perception
  function calculateRelativeBrightness(red, green, blue) {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  }

  //   create particle class
  class Particle {
    //   create initial constructor values
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 0.5;
      this.size = Math.random() * 1.5 + 1;
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      this.angle = 0;
    }

    // create update function
    // to update state of particles
    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);

      if (
        mappedImage[this.position1] &&
        mappedImage[this.position1][this.position2]
      ) {
        this.speed = mappedImage[this.position1][this.position2][0];
      }

      let movement = 2.5 - (this.speed + 1.1) * this.velocity;

      //   changes how quickly the particles spin
      this.angle += Math.random() * 0.009;

      //   adjust these values to change direction of fall
      this.y += movement * Math.sin(this.angle);
      this.x += movement * Math.cos(this.angle);
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }
      if (this.y <= 0) {
        this.y = canvas.height;
        this.x = Math.random() * canvas.width;
      }

      if (this.x >= canvas.width) {
        this.x = 0;
        this.y = Math.random() * canvas.height;
      }
      if (this.x <= 0) {
        this.x = canvas.width;
        this.y = Math.random() * canvas.height;
      }
    }

    // create draw function
    // to draw circles
    // draw() {
    //   ctx.beginPath();
    //   ctx.fillStyle = mappedImage[this.position1][this.position2][1];
    //   ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
    //   ctx.fill();
    // }
    draw() {
      //   if (
      //     mappedImage[this.position1] &&
      //     mappedImage[this.position1][this.position2]
      //   ) {
      //     ctx.strokeStyle = mappedImage[this.position1][this.position2][1];
      //   }

      //   if (this.x > 1278 && i % 2 == 0) {
      //     ctx.beginPath();
      //     ctx.moveTo(Math.random() * canvas.width, Math.random() * canvas.height);
      //     ctx.lineTo(Math.random() * canvas.width, Math.random() * canvas.height);
      //     ctx.stroke();
      //   }

      let chance = Math.random();
      ctx.beginPath();
      if (chance <= 0.99) {
        if (
          mappedImage[this.position1] &&
          mappedImage[this.position1][this.position2]
        ) {
          ctx.fillStyle = mappedImage[this.position1][this.position2][1];
        }
      }
      if (chance > 0.99) {
        ctx.fillStyle = "white";
      }
      //   ctx.beginPath();
      //   ctx.fillStyle = mappedImage[this.position1][this.position2][1];
      ctx.arc(this.x, this.y, this.size / 5, 0, Math.PI * 2);
      //   ctx.fill();

      ctx.rect(this.x, this.y, this.size * 2, this.size * 2);
      ctx.fill();
    }
  }
  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particleArray.push(new Particle());
    }
  }
  init();
  function animate() {
    ctx.globalAlpha = 0.01;
    ctx.fillStyle = "rgb(0,0,0)";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.2;
    for (let i = 0; i < particleArray.length; i++) {
      particleArray[i].update();
      ctx.globalAlpha = (particleArray[i].speed + 1.1) * 0.5;
      particleArray[i].draw();
    }
    myReq = requestAnimationFrame(animate);
  }
  animate();
});
